import React from 'react';
import { AppBar, Toolbar, IconButton, Typography, Box, Avatar, Badge, Link } from '@mui/material';
import { styled } from '@mui/system';
import Theme from '../../themes/theme'
import Background from '../../assets/background.jpg'

const Main: React.FC = () => {
    return (
        <Box sx={{
            paddingTop: '20px',
            display: 'flex',
            flexDirection: 'column'
        }}>
            <Box sx={{
                width: '100%',
                backgroundImage: `url(${Background})`,
                backgroundSize: 'cover',
                padding: '20px'
            }}>
                <Box sx={{
                    backgroundColor: Theme.palette.secondary.main,
                    borderRadius: '15px'
                }}>
                    <Typography variant='h2' >Voice Generation</Typography>
                    <Typography variant='subtitle1' >A dialog is a type of modal window that appears in front of app content to provide critical information, or prompt for a decision to be made.</Typography>
                </Box>
            </Box>
            <Box></Box>
        </Box>
    );
};

export default Main;
